from tortoise import Tortoise
import asyncio
import os
import sys
from tortoise.exceptions import IntegrityError
# sys.path.append("/Users/akshin/Desktop/codes/manager_aiogram/src")
from src.db.models import User

async def main():
    await Tortoise.init(
        db_url="sqlite://manager.sqlite3",
        modules={"models": ["src.db.models"]},
        timezone="Europe/Moscow",
    )
    await Tortoise.generate_schemas()

    data = get_data()
    for i in data:
        if data[i][0] == "General" or "#" not in data[i][0]:
            continue
        print(data[i])
        user_id, name = data[i][0][::-1].split("# ", maxsplit=1)
        user = User(
            name=name,
            user_id=int(user_id),
            topic_id=data[i][1],
            chat_id=data[i][2],
            state=5
        )
        try:
            await user.save()
        except IntegrityError:
            pass
        except Exception as e:
            print(e)
    await Tortoise.close_connections()
    



    
if __name__ == "__main__":
    asyncio.run(main())
